import React from 'react';
import styles from '../header/header.module.css'
class Header extends React.Component {


    render () {

        const navRightSide = {
            color: "red",
            marginLeft: "auto",
            float: "right",
            verticleAlign: "center"
        };
        const verticleCenterMenuOptions = {
            lineHeight: "5rem",
            textAlign: "center"
        }

        const rowStyle = {
            display: "flex",
            justifyContent: "center"
        }

        const containerExras = {
            display: "flex",
            justifyContent: "center", /* align horizontal */
            alignItems: "center" /* align vertical */
        }

        var Logo = () => {
            return (
                <a><img src="imgs/18-years.png" className={styles.logo}></img></a>
            );
        }

        var LeftSideTopNav = () => {
            return ( 
            <div className="col-3" style={verticleCenterMenuOptions}>
                <div className={styles.LogoWrapper}>
                    <Logo/>
                </div>
            </div>
            );
        }

        var RightSideTopNav = () => {
            return (
            <div className="col-9" style={verticleCenterMenuOptions}>
                <div style={navRightSide}> <p>content</p></div>
            </div>
            );
        }


        return (
            <div className={styles.headerOuter}>
                <div className="container" style={containerExras}>
                    <div className="row" style={rowStyle}>
                            <LeftSideTopNav/>
                            <RightSideTopNav/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
